import React, { useState } from 'react';
import Dashboard from './Dashboard';

// Mock FormCard component
const FormCard = ({ form }) => (
  <div className="border rounded-lg shadow-lg p-4 bg-white">
    <h3 className="font-bold text-lg">{form.title}</h3>
    <p>{form.description}</p>
  </div>
);

// Mock SearchBar component
const SearchBar = ({ onSearch }) => {
  const [query, setQuery] = useState('');

  const handleChange = (e) => {
    setQuery(e.target.value);
    onSearch(e.target.value);
  };

  return (
    <div className="mb-5">
      <input
        type="text"
        value={query}
        onChange={handleChange}
        placeholder="Search forms..."
        className="search-input p-2 border border-gray-300 rounded w-full"
      />
    </div>
  );
};

// Main App component
const App = () => {
  const [forms, setForms] = useState([
    { id: 1, title: 'Form A', description: 'This is form A.' },
    { id: 2, title: 'Form B', description: 'This is form B.' },
    { id: 3, title: 'Form C', description: 'This is form C.' },
    // Add more forms as needed
  ]);

  return (
    <div className="App">
      <Dashboard forms={forms} />
    </div>
  );
};

export default App;
